import React, { Component } from 'react';
import './Contact.css';
import Navbar from '../../components/Navbar/Navbar';
import ContactInfo from './ContactInfo/ContactInfo'

class Contact extends Component {
    render () {
        return (
            <div className='contact'>
                <Navbar></Navbar>
            </div>
        );
    };

};

export default Contact;
